import React,{useState} from "react";
import ""




const App = ()=>{
    const [number, setNumber]= useState(0)
    return <div>
      <h1> {number}</h1>  
      <button onClick={ ()=> setNumber(number+1) } name="Add">Add</button> 
      <button onClick={ ()=> setNumber(number-1) } name="Sub">Sub</button> 
      <button onClick={ ()=> setNumber(number*0) } name="Reset">Reset</button>
    </div>
}
export default App;
